package isola.model.ext.tree;import isola.helpers.JsHelper;import isola.model.ext.base.Observable;/** *  * Multi selection for a TreePanel. *  *  *  * @author Umut Gokbayrak */public class MultiSelectionModel extends Observable {	private static final long serialVersionUID = -3140150847767617898L;	private static final String TAG = "Ext.tree.MultiSelectionModel";		public MultiSelectionModel() {		super();	}		@Override	protected void _postProcessToString() {		super._postProcessToString();	}		@Override	public String toString() {		_postProcessToString();		return "new " + TAG + "(" + JsHelper.printJsObject(this) + ")";	}}